import {useAuthStore} from "../../stores/authStore";
import {client} from "../../utils/axios";
import {useNavigate} from "react-router-dom";
export default function Header() {

  const {isLoggedIn, logout} = useAuthStore()
  const navigate = useNavigate();

  const logoutHandler = async (ev) => {
    try {
      ev.preventDefault()
      await client.post('/auth/logout');
      logout()
      navigate("/")
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <header className="header">
      <nav className="navbar white">
        <div className="nav-wrapper ">
          <a href="/" className="brand-logo grey-text">Grepp</a>
          {/* 3항연산자를 사용해 분기처리, 표현식만 가능 */}
          {
            !isLoggedIn ? (<ul id="nav-mobile"
                               className="right hide-on-med-and-down grey-text">
              <li><a href="/login" className="grey-text">sign in</a></li>
              <li><a href="/member/signup" className="grey-text">sign up</a>
              </li>
            </ul>) : (<ul id="nav-mobile"
                          className="right hide-on-med-and-down grey-text">
              <li><a href="/member/mypage" className="grey-text">mypage</a>
              </li>
              <li><a href="#" onClick={logoutHandler} className="grey-text">logout</a>
              </li>
            </ul>)
          }
        </div>
      </nav>
    </header>
  )
}
